import React from 'react';
import AppMode from "./../AppMode.js";

class MainPage extends React.Component {
    ChangeModeRounds = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeFee = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeService = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeInfo = () =>{
      this.props.changeMode(AppMode.INFOPAGE)
    }

    render() {
      return(
        <div>
            <center>
            <div style={{marginTop: '30%'}}>
                <h1>This Page is under construction.</h1>
                <h2>Look three small</h2>
                <h3>This Page is under construction.</h3>
                <button onClick = {this.ChangeModeInfo}>Parking Information</button>
                <button onClick = {this.ChangeModeRounds}>Make Reservation</button>
                <button onClick = {this.ChangeModeFee}>Pay Parking Fee</button>
                <button onClick = {this.ChangeModeService}>Customer Service</button>
                </div>
            </center>
        </div>
      );
    }
}

export default MainPage;
